    "80f7": function(e) {
        e.exports = JSON.parse('{"activity_rules":["1.抽奖活动时间为2021年1月4日-2021年1月8日每天10：00-18：00；","2.抽奖共5轮，活动期间每天一轮抽奖，每个用户每轮有1次抽奖机会；","3.抽奖次数不可叠加，未使用的抽奖次数在本轮抽奖结束时自动失效；","4.活动奖品分为积分奖品和实物奖品，积分奖品实时到账，实物奖品需填写您的个人收货信息，活动结束后7个工作日内由购房通统一邮寄；","5.活动结束7天后未填写收货地址的，视为放弃领奖；","6.如发现存在恶意刷取奖励，机器模拟等恶意行为，您将不能获取奖品，已发放的奖品，购房通有权予以收回；","7.如有疑问可联系客服：杭州购房通-大饼（hzgftzfxzs);","8.活动最终解释权归杭州购房通所有。"],"prize_rules":"<div style=\\"font-size:13px;line-height:1.4em;\\">\\n    <div style=\\"color:#444;\\">杭州购房通年度之星是基于平台大数据分析，对各个奖项进行综合评选而出。评选过程严格遵循客观、公正的原则，旨在维护每一个置业顾问的努力成果。</div>\\n    <div style=\\"height:18px\\"></div>\\n    <div style=\\"color:#444;\\">\\n        <span style=\\"font-weight:bold;\\">购房通获客之星：</span>以杭州购房通2020年1月1日至2020年12月14日期间记录的平台年度咨询数据为依据进行排名，最终遴选排名杭州前3置业顾问授予获客之星称号。获客之星将会获得荣誉奖牌、实物奖品、定制礼盒、积分、首页活动展位、展位定制标签、C端朋友圈宣发海报奖励。\\n    </div>\\n    <div style=\\"height:18px\\"></div>\\n    <div style=\\"color:#444;\\">\\n        <span style=\\"font-weight:bold;\\">购房通服务之星：</span>以杭州购房通2020年1月1日至2020年12月14日期间记录的电话接通次数、咨询回复次数、日均活跃度为依据进行综合排名，最终遴选杭州排名前50置业顾问授予服务之星称号。服务之星第1-3名将会获得荣誉奖牌、实物奖品、定制礼盒、积分、首页活动展位、展位定制标签、C端朋友圈宣发海报奖励。服务之星第4-50名将会获得定制礼盒奖励。\\n    </div>\\n    <div style=\\"height:18px\\"></div>\\n    <div style=\\"color:#444;\\">\\n        <span style=\\"font-weight:bold;\\">购房通新人之星：</span>2020年9月1日至2020年11月30日期间入驻杭州购房通的置业顾问可参与评选，以入驻当天至2020年12月14日期间记录的日均积分为依据进行排名，最终遴选杭州排名前3置业顾问授予新人之星称号。新人之星将会获得荣誉奖牌、实物奖品、定制礼盒、积分、首页活动展位奖励。\\n    </div>\\n    <div style=\\"height:18px\\"></div>\\n    <div style=\\"color:#444;\\">\\n        <span style=\\"font-weight:bold;\\">购房通合作之星：</span>以杭州购房通自2020年1月1日至2020年12月14日期间记录的信息提供分、拉新置业顾问人数为依据进行综合排名，最终遴选杭州排名前50置业顾问授予购房通合作之星称号。合作之星将会获得定制礼盒奖励。\\n    </div>\\n    <div style=\\"height:18px\\"></div>\\n    <div style=\\"color:#444;\\">\\n        <span style=\\"font-weight:bold;\\">购房通引流之星：</span>以杭州购房通自2020年1月1日至2020年12月14日期间记录的引流新用户总量为依据进行排名，最终遴选杭州排名前10置业顾问授予引流之星称号。引流之星将会获得积分、定制礼盒奖励。\\n    </div>\\n    <div style=\\"height:18px\\"></div>\\n    <div style=\\"color:#888;\\">\\n    以上活动奖励兑现事宜将会有客服与您联系，如您有疑问，也可联系客服：杭州购房通-大饼（hzgftzfxzs）。\\n    </div>\\n    <div style=\\"height:18px\\"></div>\\n    <div style=\\"color:#888;\\">\\n    免责声明：本次评选置业顾问榜单，均以置业顾问在购房通平台沉淀的数据为基础，进行统计计算综合评选而成，结果仅供参考。以上奖励具体以实际发放为准，若出现突发问题，将用其他同等价值奖品代替，活动最终解释权归杭州购房通所有。\\n    </div>\\n</div>","pre_video":"https://cdn.vip-wifi.com/fangchan/video/5d352d57de048efc56115ffa3faf40be20201231.mp4","prize_video":"https://cdn.vip-wifi.com/fangchan/video/ce4647eed845938c52024cd705c8811f20210108.mp4"}');
    },
