        e.exports = JSON.parse('{"top_tip":"说明：在9月3日 23：59前成团的团队都可继续任务，结束日期自成团日起顺延5天到任务时间截止。","info":{"title":"活动简介","content":"<p>1、活动上线后，置业顾问可向平台内其他置业顾问发出组队邀请，队伍集齐3人，即可开始任务。</p><p style=\\"margin-top: 1em;\\">2、任务期间，队员通过转发楼盘航拍页面，引流的新老用户，均给予1分的活动奖励积分。</p><p style=\\"margin-top: 1em;\\">3、各团队活动周期为5天。若同一队伍的所有成员在活动期间，分别在5天内累计3天完成引流任务，活动结束后团队每人还可额外获得300积分作为奖励。</p>"},"rules":{"title":"活动细则","content":"<p>1、积分说明：</p><p>（1）活动进行期间，每人每日通过楼盘航拍页面引流的前30位用户（包括新用户和老用户），均给予1分的奖励积分。（奖励积分可以最多获取5天）</p><p>（2）引流积分=新/老用户引流积分+分享航拍页引流的奖励积分。即：分享航拍看房带来新用户+2分/老用户+1分；另成团活动奖励积分+1分。 </p><p>（3）团队所有人在活动时间内累计完成3天引流任务，系统将于本团队活动周期结束后，自动发放给每人300分奖励积分。</p><p style=\\"margin-top: 1em;\\">2、成团说明：</p><p><p>（1）每人仅有1次参与活动的机会；</p><p>（2）团队人数≥2时，无法变更队友。</p><p style=\\"margin-top: 1em;\\">3、引流任务说明：单日引流有效新老用户共计30个；</p><p style=\\"margin-top: 1em;\\">4、成团时间：2020年9月1日 00：00 ~2020年9月3日 23：59，成团成功后任务自动开启。（9月3日23：59前成团的团队都可继续任务，结束日期自成团日起顺延5天到任务时间截止。）</p><p style=\\"margin-top: 1em;\\">5、凡参与本次活动的置业顾问，即视为同意本活动规则及相关条款；</p><p style=\\"margin-top: 1em;\\">6、如对本次活动存在疑问请联系您的专属客服；活动最终解释权归杭州购房通所有。</p>"},"game_desc":"<p>你可以通过界面分享功能或小程序转发功能将楼盘航拍页面分享至好友、微信群、朋友圈，不限制楼盘，每天至少完成一次分享并获取楼盘航拍活动奖励积分<span style=\\"color: #CC4242;\\">30分</span>，活动有效期（5日）内累计完成3天转发后即完成任务。</p>"}');
