        e.exports = JSON.parse('{"rules":"一、集字有礼活动时间为2020年11月3日10:00-11月10日0:00。\\n\\n二、用户需要开启宝箱，获得字符，集齐特定的5个字符后可参与平分红包、参与抽取大奖等，开启宝箱过程中可随机获得现金红包、实物礼品等奖励。\\n\\n三、本次活动规则最终解释权归购房通所有。\\n\\n四、集字活动玩法：\\n1、用户在活动页面成功报名后方可参与活动。参与过程中可在购房通小程序页面随机获得宝箱。\\n2、获得宝箱后用户需手动开启，并随机获得现金红包、实物奖励、优惠券、特定字符等。\\n3、一共有“购”、“房”、“通”、“双”、“11”等五种字符，集齐5种字符后则自动解锁平分红包、终极大奖抽奖资格。\\n4、集字活动将于11月10日0:00截止，截止后，将无法再获得宝箱奖励。到期后，用户若已集齐五字，则可点击平分红包按钮，若未完成，则不可点击。\\n5、活动截止后，购房通将公布完成集字用户名单，届时将通过消息推送，请注意查看。\\n6、完成集字的用户可参与平分现金红包，同一用户只能领取一次。\\n7、根据微信支付规则，用户在完成实名认证后方可领取红包，否则有可能出现无法成功领取的情况。因用户个人原因导致无法领取红包，主办方概不负责。\\n8、完成集字的用户可参与终极大奖抽奖，本次活动共抽取1名用户。\\n9、平分红包将于11月10日11:00开奖，终极大奖将在11月11日11:00开奖，届时请留意。\\n10、中奖后若涉及税费的，用户需要自行缴纳。\\n\\n五、宝箱说明：\\n1、开宝箱获得的字符将自动存入集字主页中，同一种字符可重复获得，但不可赠送、不可转让、不可索要。\\n2、开宝箱获得的现金红包需要关注服务号进行领取，关注后自动发放（发放时间可能会有延迟，请耐心等待）。\\n3、开宝箱获得的实物奖励需要用户凭借真实有效的联系方式进行兑换，提交信息后请等待专属客服与您联系、进行核实兑换。\\n4、开宝箱获得的优惠券将自动存入账户的优惠券包中。\\n5、存在一定概率，打开宝箱后，宝箱不包含任何奖励。\\n6、在单页面停留30秒及以上，则在刷新当前页面或前往下一页面时会获得1个宝箱，该操作每日可开3个宝箱。\\n7、访问小程序≥3个页面（楼盘详情页的下级页面），则在刷新当前页面或前往下一个页面时必出一个宝箱，该操作每日可开3个宝箱。\\n8、分享小程序任意页面至好友，可获得1个宝箱，该操作每日最多可开1个宝箱。\\n9、每日最多可以获得10个宝箱，其中3个为隐藏福利，需用户自行探索。宝箱获得数量将在每日0:00刷新。\\n\\n六、平分红包玩法说明：\\n1、用户可在集字主页查看当前的集字完成情况，集齐字符后将自动解锁、等待开奖。在开奖倒计时结束后，方可进行红包平分。\\n2、平分红包倒计时结束后，用户需要点击平分红包进入跳转页面，关注公众号后，红包将自动发放，用户可根据提示进行关注。\\n\\n七、红包领取流程及规则说明：\\n1、获得红包的用户需要关注服务号进行领取，关注后自动发放，发放时间可能会有延迟。\\n2、红包发放后，用户需点击进行领取，领取后将自动存入微信零钱。\\n3、成功领取后，一般情况将在24小时内到账，特殊情况下因网络延迟等可能导致延迟到账。\\n\\n八、所有奖励，未特殊说明，需要在规定日期前兑换领取。若在规定日期结束后未领取，则视为主动放弃奖励。\\n\\n九、主办方可根据活动举办的实际情况，在法律允许的范围内，对本活动说明情况进行变动或调整，相关变动或调整将公布在活动页面上。\\n\\n十、如果用户以任何不正当手段或舞弊方式参与本活动，一经发现，主办方将有权采取不发放奖励等措施，亦有权收回该用户可领取的奖励，追讨已发放的奖励，并保留追究该用户责任的权利。\\n\\n十一、如果用户存在违规行为（包括不限于虚假交易、恶意套现、作弊等），购房通将取消用户的活动资格、并有权撤销相关违规交易、收回奖励等利益，同时依照相关规则进行处理。","guides":"<p>开宝箱，赢好礼！开得宝箱越多，获得字符、现金红包、实物礼品的概率就越大！</p><p style=\\"height:1em;\\"></p><p>那如何才能获得更多的宝箱呢？ 请收下这份集字攻略：</p><p style=\\"height:1em;\\"></p><p>1、任意页面浏览时长达到30秒及以上，则在刷新当前页面或前往下一个页面时必出1个宝箱，该途径每日最多可获得3个宝箱；</p><p style=\\"height:1em;\\"></p><p>2、若访问小程序任意页面≥3个，则在刷新当前页面或前往下一个页面时必出1个宝箱，该途径每日最多可获得3个宝箱；</p><p style=\\"height:1em;\\"></p><p>3、分享小程序任意界面至好友，则当日可获得1个宝箱。</p><p style=\\"height:1em;\\"></p><p style=\\"color:#DD348E;font-weight:bold;\\">以上方法每日可获得7个宝箱，每日最多可以获取10个宝箱。剩下3个隐藏宝箱，还请在购房通小程序中努力探索吧~或许会有更多发现哦！</p>","prizes":[{"name":"杭州购房通","prize":"小米空气净化器AC-M6-SC"},{"name":"杭州购房通","prize":"九阳破壁机L18-Y915S"},{"name":"杭州购房通","prize":"小米扫地机器人MJSGT1"},{"name":"杭州购房通","prize":"康佳电视机 50英寸"},{"name":"杭州购房通","prize":"美的三门冰箱 213升"},{"name":"杭州购房通","prize":"动感单车 家用级"},{"name":"杭州购房通","prize":"微波炉 美的"},{"name":"杭州购房通","prize":"烤箱 苏泊尔"},{"name":"杭州购房通","prize":"美的挂烫机YGD20D7"},{"name":"杭州购房通","prize":"华为无线耳机FreeBuds Pro"},{"name":"杭州购房通","prize":"99元红包"},{"name":"杭州购房通","prize":"66元红包"},{"name":"杭州购房通","prize":"28.88元红包"},{"name":"杭州购房通","prize":"6.66元红包"},{"name":"杭州购房通","prize":"5.20元红包"},{"name":"杭州购房通","prize":"2.88元红包"},{"name":"杭州购房通","prize":"1.88元红包"},{"name":"杭州购房通","prize":"购/房/通/双/11"},{"name":"杭州购房通","prize":"买房优惠券"}]}');
